CREATE TABLE `invoices` (
  `id` int NOT NULL AUTO_INCREMENT,
  `invoice_ownerid` int NOT NULL,
  `seller_trade_name` varchar(255) COLLATE utf8mb4_general_ci DEFAULT NULL,
  `seller_office_address` varchar(255) COLLATE utf8mb4_general_ci DEFAULT NULL,
  `seller_shipping_address` varchar(255) COLLATE utf8mb4_general_ci DEFAULT NULL,
  `seller_gstin` varchar(20) COLLATE utf8mb4_general_ci DEFAULT NULL,
  `seller_phone` varchar(20) COLLATE utf8mb4_general_ci DEFAULT NULL,
  `seller_email` varchar(255) COLLATE utf8mb4_general_ci DEFAULT NULL,
  `invoice_type` varchar(50) COLLATE utf8mb4_general_ci DEFAULT NULL,
  `buyer_gstin` varchar(20) COLLATE utf8mb4_general_ci DEFAULT NULL,
  `buyer_name` varchar(255) COLLATE utf8mb4_general_ci DEFAULT NULL,
  `buyer_phone` varchar(255) COLLATE utf8mb4_general_ci DEFAULT NULL,
  `buyer_email` varchar(255) COLLATE utf8mb4_general_ci DEFAULT NULL,
  `bill_to_address` varchar(255) COLLATE utf8mb4_general_ci DEFAULT NULL,
  `ship_to_address` varchar(255) COLLATE utf8mb4_general_ci DEFAULT NULL,
  `place_of_supply` varchar(255) COLLATE utf8mb4_general_ci DEFAULT NULL,
  `invoice_number` varchar(50) COLLATE utf8mb4_general_ci DEFAULT NULL,
  `invoice_date` date DEFAULT NULL,
  `hsn_sac` varchar(20) COLLATE utf8mb4_general_ci DEFAULT NULL,
  `products` longtext COLLATE utf8mb4_general_ci,
  `taxable_value` decimal(10,2) DEFAULT NULL,
  `final_amount` decimal(10,2) DEFAULT NULL,
  `reverse_charge` varchar(255) COLLATE utf8mb4_general_ci DEFAULT NULL,
  `no_of_pcs` int DEFAULT NULL,
  `gst_rate` decimal(5,2) DEFAULT NULL,
  `igst` decimal(10,2) DEFAULT NULL,
  `cgst` decimal(10,2) DEFAULT NULL,
  `sgst_utgst` decimal(10,2) DEFAULT NULL,
  `supply_type` varchar(50) COLLATE utf8mb4_general_ci DEFAULT NULL,
  `invoice_file` longblob,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;
